const { CANNOT_CANCEL, CANCEL_TICKET, TICKET, NO_TICKET } = '../../action/type';

const initialState = {
    Tickets: {},
    loading: true
};

const Ticket = (state = initialState, action) =>{
    const { type, payload } = action;
    switch (type) {
        case TICKETS:
            return {
                ...state,
                Ticket: payload,
                loading: false
            };
        case NO_TICKETS:
            return {
                ...state,
                loading: false
            }
        default:
            return state
    }
}

export default ticket;
